SELECT * FROM Disease_symptom_and_patient_pro 

--CHECKING FOR THE NUMBERS OF COLUMN
SELECT COUNT(*) 
FROM information_schema.columns
WHERE table_name = '<Disease_symptom_and_patient_pro>';
--This dataset has 349 entries and 10 columns.

/* Checking the number of distinct disease in the dataset
*/
SELECT COUNT (DISTINCT disease)
FROM Disease_symptom_and_patient_pro
--There are a total of 116 diseases in the dataset

/*Checking for distinct age and sorting in ascending 
order by age*/
SELECT DISTINCT( age)
FROM Disease_symptom_and_patient_pro
ORDER BY age
--We can see the patients were between ages 19 and 90

/*I'll be adding a new column and grouping age into three 
groups respectively(Young Adult, Adult and Old)*/
--ADD A NEW COLUMN NAMED AgeBracket AND GROUP
ALTER TABLE Disease_symptom_and_patient_pro
ADD COLUMN AgeBracket TEXT;
UPDATE Disease_symptom_and_patient_pro
SET AgeBracket =
CASE 
WHEN age BETWEEN 19 AND 35 THEN 'Young Adult'
WHEN age BETWEEN 36 AND 60 THEN 'Adult'
WHEN age BETWEEN 61 AND 90 THEN 'Old'
END;
--CHECKING TO SEE THAT NEW COLUMN HAS BEEN ADDED
SELECT * FROM Disease_symptom_and_patient_pro


