--CHECKING FOR THE DISTINCT COUNT OF DISEASES IN THE DATASET
SELECT COUNT(DISTINCT disease)
FROM Disease_symptom_and_patient_pro
--The dataset has 116 distinct disease 

SELECT disease, COUNT(*) AS count_of_diseases
FROM Disease_symptom_and_patient_pro
GROUP BY disease
ORDER BY count_of_diseases DESC
--Asthma had the highest count with 23

