/*What are the number of positive and negative cases at the end of 
the assessments. What are the disease with positive and 
negative outcome
I'll start by checking for the total count of positive and
negative outcome_variables then I'll be grouping disease
by outcome_variable  to see
the number of positive cases*/

SELECT COUNT(outcome_variable)
FROM Disease_symptom_and_patient_pro
WHERE outcome_variable = 'Positive'
