WHERE outcome_variable = 'Positive' AND cough = 'No'
GROUP BY cough
ORDER BY number_of_positive_cases
/*The number of cases that is positive and does not have
cough is 98*/

SELECT cough, COUNT(outcome_variable) AS number_of_negative_cases
FROM Disease_symptom_and_patient_pro
WHERE outcome_variable = 'Negative' AND cough = 'Yes'
GROUP BY cough
ORDER BY number_of_negative_cases
--The number of cases that is negative and has cough is 79

SELECT cough, COUNT(outcome_variable) AS number_of_negative_cases
FROM Disease_symptom_and_patient_pro
WHERE outcome_variable = 'Negative' AND cough = 'No'
GROUP BY cough
ORDER BY number_of_negative_cases
/*The number of cases that is negative and does not have 
cough is 84*/
/*This shows that most patients had positive assessments
but did not have cough.*/

