--RESEARCH QUESTION 4
/* What is the total count for blood pressure entries?.
What is the connection between blood_pressure and 
distinct diseases*/
SELECT blood_pressure, COUNT(*)
AS total_count_of_BP
FROM Disease_symptom_and_patient_pro
GROUP BY blood_pressure
ORDER BY total_count_of_BP DESC
/* High - recorded a total of 167
Normal - recorded a total of 164
Low - recorded a total of 18
*/

SELECT disease, COUNT(blood_pressure) 
AS number_of_patients_with_high_BP
FROM Disease_symptom_and_patient_pro
WHERE blood_pressure = 'High'
GROUP BY disease
ORDER BY number_of_patients_with_high_BP DESC
/*This shows that patients with stroke had the highest 
count for high blood pressure with 11*/

SELECT disease, COUNT(blood_pressure) 
AS number_of_patients_with_normal_BP
FROM Disease_symptom_and_patient_pro
WHERE blood_pressure = 'Normal'
GROUP BY disease
ORDER BY number_of_patients_with_normal_BP DESC
/*This shows that patients with Asthma had the highest
count for normal blood pressure with 17*/

SELECT disease, COUNT(blood_pressure) 
AS number_of_patients_with_low_BP
FROM Disease_symptom_and_patient_pro
WHERE blood_pressure = 'Low'
GROUP BY disease
ORDER BY number_of_patients_with_low_BP DESC
/*All disease in this code has the same number of patients
with low blood pressure*/

