--RESEARCH QUESTION 6
/*What is the relationship between Age Bracket and 
outcome_variable.
Age bracket has been divivded into 3 which is:
Young Adult ages (19-35)
Adult ages (36-60)
Old ages (61-90)*/

SELECT outcome_variable, COUNT(age) AS number_of_patients
FROM Disease_symptom_and_patient_pro
WHERE agebracket ='Young Adult'
GROUP BY outcome_variable
ORDER BY number_of_patients DESC
--52 Young Adults has positive cases while 45 has negative cases

SELECT outcome_variable, COUNT(age) AS number_of_patients
FROM Disease_symptom_and_patient_pro
WHERE agebracket = 'Adult'
GROUP BY outcome_variable
ORDER BY number_of_patients DESC
--105 Adults has positive cases while 102 has negative cases.

SELECT outcome_variable, COUNT(age) AS number_of_patients
FROM Disease_symptom_and_patient_pro
WHERE agebracket = 'Old'
GROUP BY outcome_variable
ORDER BY number_of_patients DESC
--29 Old has positive cases while 16 has negative cases.
/*ANSWER:The agebracket that had the highest positive and
negative cases was the Adult ages(36-60).*/

